CREATE TABLE IF NOT EXISTS Admin (
	AdminID INTEGER PRIMARY KEY AUTOINCREMENT,
	Username VARCHAR(30),
	Password VARCHAR(255)
);

create table IF NOT EXISTS Category (
  SkillCategoryId VARCHAR(32) primary key,
  Label VARCHAR(100) not null,
  SortValue VARCHAR(10) not null
);

create table IF NOT EXISTS Company (
   CompanyCode VARCHAR(2) primary key,
   Label VARCHAR(20) not null,
   ManagerEmployeeNumber integer not null
);

create table IF NOT EXISTS CompanyOfficeGroup (
   CompanyCode          VARCHAR(2)           not null,
   OfficeCode           VARCHAR(2)           not null,
   GroupCode            VARCHAR(2)           not null,
   Label                VARCHAR(20)          not null,
   ManagerEmployeeNumber integer             not null,
   primary key (CompanyCode, OfficeCode, GroupCode)
);

create table IF NOT EXISTS Employee (
   isContractor         int              not null,
   SupervisorEmployeeNumber integer,
   EmployeeNumber       integer              primary key AUTOINCREMENT,
   CompanyCode          VARCHAR(2)           not null,
   OfficeCode           VARCHAR(2)           not null,
   GroupCode            VARCHAR(2)           not null,
   LocationId           VARCHAR(20)          not null,
   LastName             VARCHAR(50),
   FirstName            VARCHAR(25),
   EmploymentType       VARCHAR(10),
   Title                VARCHAR(50),
   HireDate             DATE,
   TerminationDate      DATE,
   YearsPriorExperience NUMERIC(3,1),
   Email                VARCHAR(50),
   WorkPhone            VARCHAR(24),
   WorkCell             VARCHAR(24),
   PhotoUrl             VARCHAR(255),
   Bio                  varchar(255),
   ExtraInfo            varchar(255)
);

create table IF NOT EXISTS EmployeeSkills (
   EmployeeNumber       int                  not null,
   SkillId              VARCHAR(32)          not null,
   primary key (EmployeeNumber, SkillId)
);

create table IF NOT EXISTS Location (
   LocationId           VARCHAR(20)          primary key,
   Label                VARCHAR(100)         not null,
   SortValue            VARCHAR(100)         not null
);

create table IF NOT EXISTS Office (
   CompanyCode          VARCHAR(2)           not null,
   OfficeCode           VARCHAR(2)           not null,
   Label                VARCHAR(20)          not null,
   ManagerEmployeeNumber int                 not null,
   primary key (CompanyCode, OfficeCode)
);

create table IF NOT EXISTS Skill (
   SkillCategoryId      VARCHAR(32)          not null,
   SkillId              VARCHAR(32)          primary key,
   Label                VARCHAR(100)         not null,
   SortValue            VARCHAR(10)          not null
);











